<div class="entities" style="line-height: 2.5; direction: ltr">Separation of plasminogen activators from human plasma and a comparison with activators from human uterine tissue and urine . Normal human plasma contains acid-stable as well as labile plasminogen activators . The activity of activators in plasma euglobulins was inhibited by 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #CC9966); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00513
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MENMAX</span>
</mark>

<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00513
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 in an uniform pattern , similar to that obtained with the major activators in human uterine tissue or with the purified porcine tissue activator , but different from the patterns obtained with plasmin or with urokinase . Gel filtration at high ionic strength separated activators corresponding to particle sizes of 60,000 dalton and about 10,000 dalton , corresponding to two activators similarly obtained from human tissue . The 60,000 dalton activator was precipitated in the euglobulin fraction . Its concentration increased in plasma after exercise . The 10,000 dalton activator was found mainly in the supernatant . Gel filtration in 0.15 M solutions yielded activators in fractions of molecular sizes of 100-140 , 000 dalton and 200,000 dalton or larger . The activity of normal and exercise euglobulins was inhibited by antiserum to a plasminogen activator prepared from porcine tissue , but it was not inhibited by antiserum to urokinase . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00747
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 activators in human plasma euglobulins resembled immunochemically the activators in human uterine tissue .</div>

<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Lack of endothelial nitric oxide synthase aggravates murine pneumococcal meningitis . DB00435 ( NO ) plays a central role in the pathogenesis of bacterial meningitis . However , the role of NO produced by endothelial NO synthase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29474
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) in meningitis is still unclear . We investigated the influence of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29474
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 depletion on the inflammatory host response , intracranial complications , and outcome in experimental pneumococcal meningitis . Leukocyte accumulation in the cerebrospinal fluid was more pronounced in infected 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29474
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - deficient mice than in infected wild type mice . This effect could be attributed to an increased expression of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P16109
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , macrophage inflammatory protein - 2 , keratinocyte-derived cytokine , and interleukin ( IL ) - 1beta in the brain of infected 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29474
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - deficient mice . However , no differences in the cerebral expression of intercellular adhesion molecule - 1 , tumor necrosis factor-alpha , and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05231
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 as well as of neuronal NOS and inducible NOS could be detected between infected wild type and mutant mice . In addition to enhanced leukocyte infiltration into the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04141
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , meningitis-associated intracranial complications including blood-brain barrier disruption and the rise in intracranial pressure were significantly augmented in infected 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29474
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - deficient mice . The aggravation of intracranial complications was paralleled by a worsening of the disease , as evidenced by a more pronounced hypothermia , an enhanced weight reduction , and an increased death rate . The current data indicate that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P29474
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 deficiency is detrimental in bacterial meningitis . This effect seems to be related to an increased expression of ( certain ) cytokines / chemokines and adhesion molecules ; thus leading to increased meningeal inflammation and , subsequently , to aggravated intracranial complications .</div>

<h2 style="margin: 0">2</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Indirubin - 3 ' - ( 2,3 dihydroxypropyl ) - oximether ( E804 ) is a potent modulator of LPS-stimulated macrophage functions . Indirubin is a deep-red bis-indole isomer of indigo blue , both of which are biologically active ingredients in Danggui Longhui Wan , an ancient Chinese herbal tea mixture used to treat neoplasia and chronic inflammation and to enhance detoxification of xenobiotics . Multiple indirubin derivatives have been synthesized and shown to inhibit cyclin-dependent kinases ( CDKs ) and glycogen-synthase kinase ( GSK - 3 ) with varying degrees of potency . Several indirubins are also aryl hydrocarbon receptor (

 (  ) ) . OBJECTIVE : To characterize the novel , high-affinity cannabinoid receptor 1 ( CB ( 1 ) R ) HHC-ligand AM2389 [ 9 - hydroxy - 3 - ( 1 - hexyl-cyclobut - 1 - yl ) - hexahydrocannabinol in two rodent pre-clinical assays . MATERIALS AND METHODS : CB ( 1 ) R mediation of AM2389 - induced hypothermia in mice was evaluated with AM251 , a CB ( 1 ) R-selective antagonist / inverse agonist . Additionally , two groups of rats discriminated the full cannabinergic aminoalkylindole AM5983 ( 0.18 and 0.56 mg / kg ) from vehicle 20 min post-injection in a two-choice operant conditioning task motivated by 0.1 % saccharin / water . Generalization / substitution tests were conducted with AM2389 , AM5983 , and  ( 9 ) - tetrahydrocannabinol (  ( 9 ) - THC ) . RESULTS :  ( 9 ) - THC ( 30 mg / kg ) - induced hypothermia exhibited a faster onset and shorter duration of action compared with AM2389 ( 0.1 and 0.3 mg / kg ) . AM251 ( 3 and 10 mg / kg ) attenuated / blocked hypothermia induced by 0.3 mg / kg AM2389 . In drug discrimination , the order of potency was AM2389 &gt; AM5983 &gt;  ( 9 ) - THC with ED ( 50 ) values of 0.0025 , 0.0571 , and 0.2635 mg / kg , respectively , in the low-dose condition . The corresponding ED ( 50 ) values in the high-dose condition were 0.0069 , 0.1246 , and 0.8438 mg / kg , respectively . Onset of the effects of AM2389 was slow with a protracted time-course ; the functional , perceptual in vivo half-life was approximately 17 h . CONCLUSIONS : This potent cannabinergic HHC exhibited a slow onset of action with a protracted time-course . The AM2389 chemotype appears well suited for further drug development , and AM2389 currently is used to probe behavioral consequences of sustained ECS activation .</div>

<h2 style="margin: 0">18</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , an agonist of Q9NYK1 , reduces plasma virus concentration in chronic hepatitis C infection . Immune-based therapy is the mainstay treatment for chronic hepatitis C virus ( HCV ) infection but causes multiple side effects and achieves durable viral clearance in only approximately 50 % of patients . Most new investigational anti-HCV compounds are direct-acting antivirals for which durability of response and risk of viral mutations and resistance are not yet known . Therefore , continuing discovery and development of new immune-based treatments is desirable . Toll-like receptors ( TLRs ) are pathogen recognition receptors that initiate the innate immune response . The responsiveness of HCV or other ongoing chronic systemic infections to treatment with a selective TLR agonist has not been reported .

 is a selective agonist of Q9NYK1 . In a proof-of-concept study , we found that once-daily 7 - day treatment with intravenous isatoribine 800 mg caused a significant ( P = . 001 ) reduction of plasma HCV RNA ( mean , -0.76 ; range , -2.85 to +0.21 log ( 10 ) units ) in otherwise untreated patients ( n = 12 ) who were chronically infected with HCV . Viral load reduction occurred in patients infected with genotype 1 as well as non-genotype 1 HCV . The reduction of viral load was correlated with induction of markers of a heightened immune antiviral state , including 2 ' - , 5 ' - oligoadenylate synthetase levels in whole blood . This treatment was well tolerated , with a low frequency of mild to moderate adverse events . In conclusion , systemic administration of the selective Q9NYK1 agonist isatoribine resulted in dose-dependent changes in immunologic biomarkers and a statistically significant antiviral effect with relatively few and mild side effects .</div>
